// Navigation Bar and Header
import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import styled from 'styled-components';

const selectedNav = {
    color: '#F28F38'
}

const StyledLink = styled(NavLink)`
    &:focus,  &:hover {
    color: #F28F38;
  }
`;

class Navigation extends Component {
    render() {
        return (
            <nav className="navbar fixed-top bg-white shadow-sm navbar-expand-lg">
                <StyledLink to="/" className="navbar-brand font-weight-500 text-primary text-decoration-none" id="logo-header">
                    <h4 className="mb-0 font-weight-normal">Sound Sustainability</h4>
                </StyledLink>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNav">
                    <ul class="navbar-nav">
                        <li class="nav-item">
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/screeninghome" >Hearing Screening</StyledLink>
                        </li>
                        <li class="nav-item">
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">Education</StyledLink>
                        </li>
                        <li class="nav-item">
                            <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/screening">Devices</StyledLink>
                        </li>
                        <li class="nav-item">
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">About Us</StyledLink>
                        </li>
                        <li class="nav-item">
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">Sign In</StyledLink>
                        </li>
                    </ul>





                </div>
            </nav>
        );
    }
}

export default Navigation;
